    def optimize_cycle(self):
        # Extract input values from GUI components
        P_High = float(self.le_PHigh.text())  # High pressure (bar)
        P_Low = float(self.le_PLow.text())  # Low pressure (bar)
        turbine_efficiency = float(self.le_TurbineEff.text())  # Turbine isentropic efficiency

        # Define the objective function for optimization
        def objective_function(params):
            P_Mid, T_Mid = params


            P_High = 80.0  # High pressure (bar)
            P_Low = 0.08  # Low pressure (bar)
            turbine_efficiency = 0.85  # Turbine isentropic efficiency

            # Calculate cycle efficiency
            cycle_efficiency = calculate_cycle_efficiency(P_High, P_Mid, P_Low, T_Mid, turbine_efficiency)

            # Minimize negative efficiency (maximize efficiency)
            return -cycle_efficiency

        # Define the function to calculate cycle efficiency
        def calculate_cycle_efficiency(P_High, P_Mid, P_Low, T_Mid, turbine_efficiency):
            # Calculate temperatures
            T_High = get_temperature_from_pressure(P_High)  # High temperature (°C)
            T_Low = get_temperature_from_pressure(P_Low)  # Low temperature (°C)

            # Calculate specific work for turbine 1 (from High to Mid)
            specific_work_1 = calculate_specific_work(T_High, T_Mid, turbine_efficiency)

            # Calculate specific work for turbine 2 (from Mid to Low)
            specific_work_2 = calculate_specific_work(T_Mid, T_Low, turbine_efficiency)

            # Calculate cycle efficiency
            cycle_efficiency = (specific_work_1 + specific_work_2) / (T_High - T_Low)

            return cycle_efficiency

        # Define a helper function to calculate specific work across a turbine
        def calculate_specific_work(T_inlet, T_outlet, efficiency):
            return (T_inlet - T_outlet) / (efficiency * T_inlet)

        # Define a helper function to get temperature from pressure (ideal gas law approximation)
        def get_temperature_from_pressure(P):
            R = 0.287  # Gas constant for air (kJ/kgK)
            return 273.15 + (P * 100) / (1.005 * R)  # Convert pressure to Pa for calculation

        # Perform optimization to find optimal P_Mid and T_Mid
        initial_guess = [20.0, 200.0]  # Initial guess for P_Mid (bar) and T_Mid (°C)
        bounds = [(20.0, 60.0), (300.0, 500.0)]  # Bounds for P_Mid and T_Mid

        result = minimize(objective_function, initial_guess, bounds=bounds)

        # Extract optimal values
        P_Mid_optimal, T_Mid_optimal = result.x
        optimal_efficiency = -result.fun  # Convert back to positive (actual efficiency)

        print("Optimal P_Mid:", P_Mid_optimal, "bar")
        print("Optimal T_Mid:", T_Mid_optimal, "°C")
        print("Optimal Cycle Efficiency:", optimal_efficiency)